import { useAlert } from 'react-alert';
import { useDispatch, useSelector } from 'react-redux';
import { fetchContact } from '../../redux/reduxAxois/fetchContact';
import DashSideBar from './DashSideBar'

const AdminContact = () => {


  const alert = useAlert();

  const dispatch = useDispatch();
  const contact = useSelector((state) => state.contact);
  const {allQuries, loading} = contact

  console.log(allQuries.length);

  const [loader, setLoader]=useState(true)


  useEffect(() => {

    fetchContact(dispatch);
    if(!loading){
      setLoader(false)
    }


  }, [dispatch, alert])

  return (
    <div style={{display:'flex', position:"fixed", width:"100vw", zIndex:"10000", background:"white"}}>
    <DashSideBar />
      <div>
      AdminContact
      </div>


    </div>
  )
}

export default AdminContact
